        let link = 'f'
        
        navigate(filterLink)
    }

    let addFilter = () => {        
        setFilterLink(!filterLink)        
    }


    
    
  return (
    <div>
        <form method='submit' onSubmit={filterNavigate}>
           <div className="form-check form-check-inline">
                <input className="form-check-input" type="submit" id="free" value="free" onChange={addFilter} defaultChecked={filterLink} />
                <label className="form-check-label" htmlFor="inlineCheckbox1">Free</label>
